import styled from 'styled-components';
import { mediaQuerie } from '../../../styles/responsive/responsive';

export const Container = styled.nav`
  height: 72px;
  width: 100vw;
  background-color: red;
  display: flex;
  padding: 12px 32px;

  ${mediaQuerie.sm`
    background-color: yellow;
    border-radius: 50%;
  `}
`;
